import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import { connect } from "react-redux";
import * as actionTypes from "../../store/actions/actions";
const Form = () => {
  return (
    <div>
      <form>
        <TextField></TextField>
        <Button onClick={() => this.onStoreResult()} style={{ color: "black" }}>
          送信
        </Button>
      </form>
      {/* <ul>
        {this.props.add.map((l) => (
          <li key={l.id}>{l.value}</li>
        ))}
      </ul> */}
    </div>
  );
};
const mapStateToProps = (state) => {
  return {
    add: state.add.todo
  };
};
const mapDisptchToProps = (dispatch) => {
  return {
    onStoreResult: () => dispatch({ type: actionTypes.ADD }),
    onDeleteResult: () => dispatch(actionTypes.REMOVE)
  };
};

export default connect(mapStateToProps, mapDisptchToProps)(Form);
